import React, { Component } from 'react';
import ReactDOM from 'react-dom';

export class App extends Component {
	constructor(props) {
		super(props);
		this.state = {
			lat: null,
		};
	}
	render() {
		return (
			<div>
				<h3> Latitude:</h3>
			</div>
		);
	}
}

ReactDOM.render(<App />, document.querySelector('#root'));
